<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaCallsOnline/show&amp;time=2007-06-14+17%3A53%3A59</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaCallsOnline&amp;amp;v=1aru" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Calls&amp;nbsp;Info&amp;nbsp;/&amp;nbsp;Форма&amp;nbsp;Calls&amp;nbsp;Online&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaCallsOnline&amp;amp;time=2007-06-14+17%3A53%3A59">2007-06-14 17:53:59&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaCallsOnline&amp;amp;time=2007-06-14+18%3A00%3A24">2007-06-14 18:00:24&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">||**Select originate/terminate operator**|
Выбрать конкретного оригинирующего или&amp;nbsp;терминирующего операторов для&amp;nbsp;просмотра только его&amp;nbsp;звонков.
||&lt;strong>Select originate/terminate ip&lt;/strong>|&lt;br />
Если вы&amp;nbsp;выбрали конкретного оператора, в&amp;nbsp;этом поле можно выбрать конкретный ip-адрес оператора для&amp;nbsp;просмотра.&lt;br />
||**Select mera server**|
Поле для&amp;nbsp;выбора определенного MVTS-сервер, где&amp;nbsp;вы&amp;nbsp;хотите просмотреть звонки.
||&lt;strong>Enter destination number&lt;/strong>|&lt;br />
Если требуется получить лист звонков, начинающихся на&amp;nbsp;определенные цифры кода, то&amp;nbsp;в этом поле нужно ввести первые цифры.&lt;br />
||**Refresh time (sec.)**|
Время обновления информации, как&amp;nbsp;часто AMBS будет забирать данные с&amp;nbsp;MVTS-сервера и&amp;nbsp;обновлять страницу. Не&amp;nbsp;рекомендуется ставить это&amp;nbsp;значение меньше 10 секунд.
||&lt;strong>Destination number&lt;/strong>|&lt;br />
Номер вызываемого абонента.&lt;br />
||**Host**|
Хост-сервер, через который идут звонки.
||&lt;strong>Src bytes in&lt;/strong>|&lt;br />
Количество байт, принятых от&amp;nbsp;оригинирующего оператора&lt;br />
||**Src bytes out**|
Количество байт отправленных оригинирующему оператору.
||&lt;strong>Destination ip&lt;/strong>|&lt;br />
Показывать адрес получателя.&lt;br />
||**Originate operator**|
Показать названия оригинирующих операторов.
||&lt;strong>Source ip&lt;/strong>|&lt;br />
Показывать адрес, откуда пришел звонок.&lt;br />
||**Elapsed time**|
Прошедшее время с&amp;nbsp;начала звонка.
||&lt;strong>Dst bytes in&lt;/strong>|&lt;br />
Количество байт, принятых от&amp;nbsp;терминирующего оператора.&lt;br />
||**Terminate operator**|
Показать название терминирующих операторов.
||&lt;strong>Dst bytes out&lt;/strong>|&lt;br />
Количество байт отправленных терминирующему оператору.&lt;br />
||**Source Number**|
Номер вызывающего абонента.
||&lt;strong>details&lt;/strong>|&lt;br />
Будет выдаваться полная детальная информация в&amp;nbsp;виде списка звонков.&lt;br />
||**summary**|
Суммарная статистика в&amp;nbsp;виде двух полей: количество нулевых звонков и&amp;nbsp;не нулевых.
||&lt;strong>summary operator&lt;/strong>|&lt;br />
Суммарная статистика по&amp;nbsp;операторам. Сколько сейчас проходит звонков от&amp;nbsp;каждого оператора.&lt;br />
&lt;em>&lt;u>Примечание:&lt;/u> Не&amp;nbsp;рекомендуется использовать периоде обновления данных меньше 10 секунд, при&amp;nbsp;детальным режиме отображения информации это&amp;nbsp;может привести к&amp;nbsp;проблемам в&amp;nbsp;работе софтсвича.&lt;/em>&lt;/div>&lt;br />
